import { useState } from "react";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { title: "My new website", body: "lorem ipsum...", author: "Mario", id: 1 },
    {
      title: "My new website",
      body: "lorem ipsum...",
      author: "Gabriel",
      id: 2,
    },
    {
      title: "My new website",
      body: "lorem ipsum...",
      author: "George",
      id: 3,
    },
  ]);
  return (
    <div className="home">
      <h2>Homepage</h2>
    </div>
  );
};

export default Home;
